import React from "react";
import { link } from "fs";

export const themes = {
  light: {
    name: 'Light',
    color: '#000000',
    background: '#eeeeee',
    'A:visited': {
      color: '#000000'
    },
    'A:link': {
      color: '#000000'
    }
  },
  dark: {
    name: 'Dark',
    color: '#ffffff',
    background: '#222222',
    'A:visited': {
      color: '#ffffff'
    },
    'A:link': {
      color: '#ffffff'
    }
  },
};

export const ThemeContext = React.createContext(
  themes.dark // default value
);
